module.exports = [{"SLoepID":"7","Name":"All Peoples Congress (APC)","Description":"<p>The All People's Congress is one of two major political parties in Sierra Leone, the other being the Sierra Leone People's Party (SLPP). The APC is currently the ruling party in Sierra Leone. The APC party was founded in 1960 by a breakaway group from the Sierra Leone People's Party that vehemently opposed elections before independence and instead supported independence before elections. The APC governed the country from 1968 to 1992 and became the ruling party again in 2007 after the party presidential candidate Ernest Bai Koroma won the 2007 presidential election. The APC under Ernest Bai Koroma has continued as the ruling party into the 2018 election cycle</p>","Acronym":"APC","DateFounded":"1960","Founders":"Siaka Stevens","Website":"http://www.apcparty.org ","Color":"FF0000","Logo":"APC logo.jpg"},{"SLoepID":"6","Name":"Alliance Democratic Party (ADP)","Description":"","Acronym":"ADP","DateFounded":"","Founders":"","Website":"","Color":"Pink","Logo":"adp.jpg"},{"SLoepID":"8","Name":"Citizens Democratic Party (CDP)","Description":"","Acronym":"CDP","DateFounded":"","Founders":"Gibril Thullah","Website":"","Color":"","Logo":"cdp.png"},{"SLoepID":"84","Name":"Citizens United for Peace and Progress (CUPP)","Description":"CUPP, Founded in 2001 by Sierra Leoneans in the United States, the CUPP advocates \"justice for victims\" of the decade-long civil war. The party presented a presidential candidate in 2012, Washington lawyer Raymond Bamidele Thompson (who received 0.4 percent of the bote) but no legislative candidate.","Acronym":"CUPP","DateFounded":"2001","Founders":"","Website":"","Color":"","Logo":""},{"SLoepID":"1035","Name":"Coalition for Change (C4C)","Description":"<p>C4C is a movement that we say has been in the making for more than 59 years. It is built on the hopes and dreams of a properly functional Sierra Leone that will have sustainable development plans and national prosperity.</p>\n\n<p>We believe that we have a group of level-headed Sierra Leoneans from all disciplines of life who are well-intentioned that want to bring about transparent government, better fiscal policies, education and training for our citizens and a respected justice system, among other things.</p>\n\n<p>We believe that we can bring together a coalition of existing parties to put our aims into effect.</p>\n\n<p>At present we have global executives and country-specific executives whose job it has been to create relevant legal entities from which the movement can operate.</p>\n\n<p>We have groups of people dealing with specific tasks which makes us agile enough to deal with anything that we have been able to foresee.</p>\n\n<p>This movement is open to ALL Sierra Leoneans, and we welcome all your comments, questions and suggestions as we formulate and crystallize our plans.</p>","Acronym":"C4C","DateFounded":"2017","Founders":"","Website":"https://c4csalone.com/ ","Color":"Orange","Logo":"c4c.png"},{"SLoepID":"86","Name":"Convention People&#039;s Party (CCP)","Description":"","Acronym":"CCP","DateFounded":"","Founders":"","Website":"","Color":"","Logo":""},{"SLoepID":"1040","Name":"Democratic Centre Party (DCP)","Description":"","Acronym":"DCP","DateFounded":"","Founders":"","Website":"","Color":"","Logo":""},{"SLoepID":"83","Name":"Grand Alliance Party (GAP)","Description":"","Acronym":"GAP","DateFounded":"","Founders":"","Website":"","Color":"","Logo":""},{"SLoepID":"876","Name":"Independent (I)","Description":"","Acronym":"I","DateFounded":"","Founders":"","Website":"","Color":"","Logo":""},{"SLoepID":"82","Name":"Movement for Progress Party (MPP)","Description":"<p>MOP, formed in 2002 to promote \"good governance and positive change,\" the MOP supported the creation of the special war crimes court and presented the only female candidate in 2002, longtime political activist Zainab Bangura. She garnered less than 1 percent of the vote. Bangura, who had been a co-worker with Ernest Bai Koroma at an insurance company, Subsequently joined the APC and in 2007 was named to the post of foreign minister in President Koroma's new cabinet.</p>","Acronym":"MOP","DateFounded":"2002","Founders":"","Website":"","Color":"","Logo":""},{"SLoepID":"9","Name":"National Democratic Alliance (NDA)","Description":"<p>The NDA fielded candidates for the legislature but not the presidency in 2002. the party reconvened in 2005 after having been inactive for several years. In 2007 the NDA formed an alliance with the PLP to back Vice President Solomon Berewa of the SLPP in the presidential runoff elections. The NDA's candidate, Amadu Jalloh, finished fifth, with about 1 percent of the Vote, in the first round of balloting.</p>","Acronym":"NDA","DateFounded":"2001","Founders":"","Website":"","Color":"Green ","Logo":"nda.png"},{"SLoepID":"81","Name":"National Grand Coalition (NGC)","Description":"","Acronym":"NGC","DateFounded":"2017","Founders":"","Website":"","Color":"Red, green, blue,black, gold,white","Logo":"ngc.png"},{"SLoepID":"10","Name":"National Progressive Democrats (NPD)","Description":"National Interest, Progress For We All, Enh Respect for we Democracy\"* NPD is a transformational political party, a nationalist party that believes in Progressive values.\n\nNational Interest is the foundation of the party, to ensure that there is progress in the lives of our people, is the reason for the formation of the party and respect for democracy is our guiding principle","Acronym":"NPD","DateFounded":"","Founders":"","Website":"","Color":"0000FF","Logo":"npd.jpeg"},{"SLoepID":"1008","Name":"National Unity and Reconciliation Party (NURP)","Description":"","Acronym":"NUP","DateFounded":"2017","Founders":"","Website":"","Color":"","Logo":""},{"SLoepID":"1038","Name":"National Unity Party (NUP)","Description":"","Acronym":"NUP","DateFounded":"","Founders":"","Website":"","Color":"","Logo":""},{"SLoepID":"12","Name":"Peace and Liberation Party (PLP)","Description":"<p>The PLP was led by the former AFRC leader Johnny Paul Koroma. It was linked with the Grassroots Awareness movement, one of many peace promotion organizations. In the May 2002 elections, Koroma came in third in the presidential race, while the party won 3.6 percent of the vote - and two seat - in the legislative contest. Though Koroma was indicted in 2003, he remained the party's leader, the party spokesperson said in 2007 . However, it was later reported that Koroma was dead.</p>\n\n<p>in the 2017 presidential election, Kandeh Baba Conteh came in sixth in the first round, with 0.6 percent of the vote. The PLP was ruled ineligible to participate in the 2008 local elections. The status of the party remained unclear.</p>","Acronym":"PLP","DateFounded":"2001","Founders":"","Website":"","Color":"Blue","Logo":"plp.png"},{"SLoepID":"1039","Name":"People&#039;s National Convention (PNC)","Description":"","Acronym":"PNC","DateFounded":"","Founders":"","Website":"","Color":"","Logo":""},{"SLoepID":"11","Name":"Peoples Democratic Party (PDP)","Description":"<p>The PDP was characterized by West Africa as the \"loudest\" of the new parties, whose \"main handicap is the uncharismatic quality\" of its leader, former information minister Thaimu Bangura. In September 1991 Bangura had been named chair of the United Front of Political Movements (UNIFORM), a six party opposition formation that was subsequently dissolved.</p>\n\n<p>In the February 1996 balloting, Bangura placed third in the presidential contest, with 16.1 percent of the vote, and the party won 12 seats. Subsequently, as an apparent reward for supporting Kabbah in the second round of presidential balloting, the PDP secured three cabinet portfolios.</p>\n\n<p>Bangura died in March 1999. Following infighting between Osman Kamara and former NPRC member Abdul Rahman Kamara to replace Bangura. Osman Kamara was elected chair . Abdul Rahman Kamara quit the party to form his own organization, the People's Democratic Alliance (PDA) in November. In a cabinet reshuffle in March 2001. Osman Kamara was given the post of trade and industry minister, although he claimed that the PDP was still an opposition party. He was Subsequently replaced. The PDP, with 1 percent of the vote, failed to win a seat in the legislative election of May 2012. Following the election, one cabinet member affiliated with the PDP subsequently joined the SLPP. The party did not did not present a presidential candidate but came out in support of kabbah, Several party officials were expelled in 2006 for alleged financial malfeasance. The party did not participate in the 2007 elections.</p>","Acronym":"PDP","DateFounded":"1991","Founders":"Thaimu Bangura ","Website":"","Color":"","Logo":""},{"SLoepID":"13","Name":"Peoples Movement for Democratic Change (PMDC)","Description":"<p>ThePeople's Movement for Democratic Change (PMDC)is a sociallyliberalpartyin Sierra Leone. It is a breakaway faction of the Sierra Leone People Party(SLPP). It was officially registered on 19 January 2006. The party is led by Charles Margai, the son of Sierra Leone's second prime minister Sir Albert Margai and the nephew of Sir Milton Margai. The PMDC is based in the country's second largest city of Bo.</p>\n\n<p>Margai, as the PMDC's candidate in August 2007 Presidential Election, received third place, behind Ernest Bai Koromaof the opposition All Peoples Congress(APC) and Solomon Berewaof the SLPP. On August 19, Margai stated his support for Koroma in the second round of the election.On August 20, the PMDC's Karamoh Kabba explained what he said was the reasoning behind the decision: the PMDC sought to \"ensure a more representative government, the survival of the PMDC as a political party and the creation of a third formidable political force for smooth running of democracy in Sierra Leone\". Furthermore, backing the APC would help to bridge the regional political divide marking Sierra Leone's politics (the SLPP and PMDC draw their main support from the south, while the APC draws its main support from the north), while backing the SLPP would deepen it. He added that the APC had a natural reason to want the PMDC to survive, while the SLPP had a natural reason to want to destroy it.</p>\n\n<p>Margai's support for the APC provoked controversy in the PMDC, with some feeling that his decision was made without properly consulting the party. Margai said on August 24 that the PMDC would campaign together with the APC for the second round.</p>\n\n<p>At the parliamentary election that was held on the same day as the first round of the 2007 presidential elections, the PMDC became the third largest party in Parliament with 10 seats (out of 112). In the 2008 Local Government elections, the PMDC did less well, winning only one Council Chairperson seat (out of 19), and 4% of the council seats. All seats won by the party were in the Southern region, specifically in the Bo, Bonthe, Moyamba and Pujehun districts.</p>\n\n<p>In the 2012 elections the party lost all of its remaining seats.</p>","Acronym":"PMDC","DateFounded":"January 19, 2006","Founders":"Charles Margai ","Website":"","Color":"Green, Orange","Logo":"Logo_PMDC_SierraLeone.png"},{"SLoepID":"1041","Name":"Republic National Independent Party (RNIP)","Description":"","Acronym":"RNIP","DateFounded":"","Founders":"","Website":"","Color":"","Logo":""},{"SLoepID":"14","Name":"Revolutionary United Front Party (RUFP)","Description":"","Acronym":"RUFP","DateFounded":"","Founders":"","Website":"","Color":"","Logo":"rufp.jpg"},{"SLoepID":"14","Name":"Revolutionary United Front Party (RUFP)","Description":"","Acronym":"RUFP","DateFounded":"","Founders":"","Website":"","Color":"","Logo":"rufp.jpg"},{"SLoepID":"15","Name":"Sierra Leone Peoples Party (SLPP)","Description":"<p>The Sierra Leone People's Party (abbreviated SLPP) is one of the two major political parties in Sierra Leone, along with the All People's Congress (APC). The party dominated Sierra Leone's politics from its foundation in 1951 to 1967, when it lost the 1967 parliamentary election to the APC, led by Siaka Stevens. It identifies as a social democratic party. The SLPP returned to power when its leader Ahmad Tejan Kabbah won the 1996 presidential election. The party was in power from 1996 to 2007, when it again lost to the APC, led by Ernest Bai Koroma, in the 2007 presidential election</p>\n\n<p>SLPP dominated politics in Sierra Leone in the years following World War II. In 1955 and 1956, riots occurred in Sierra Leone, originally sparked by the artisan union's strike over pay; further unrest followed strikes by transport workers. These events grew animosity between the SLPP and Krio parties, especially the Cyril Rogers-Wright led United Sierra Leone Progressive Party, established in 1954. The SLPP positioned itself as \"the countryman's party,\" and garnered the support of tribal chiefs.</p>\n\n<p>After elections in 1957, Milton Margai bowed to behind-the-scenes pressure and stepped down from SLPP leadership, replaced by his brother Albert Margai. However, in 1958, Albert Margai and Siaka Stevens launched a new party, the People's National Party (PNP), which aimed for greater African involvement in the British colonial government. With the independence of Ghana in 1957, the PNP sought the support of the educated elite to lead a transition to independence. Stevens would later leave the party to form the northern-supported All Peoples Congress. Upon independence in 1961, Milton Margai became Prime Minister, and the SLPP became the ruling party. The SLPP, along with almost all Sierra Leonean political parties, signed the constitution at the London constitutional conference; the APC was the notable exception. This unity did not extend to national politics, as opposing politicians often faced detainment under SLPP rule.</p>","Acronym":"SLPP","DateFounded":"1951","Founders":"Etheldred National Jones/Lamina Sankoh","Website":"","Color":"008000","Logo":"slpp.png"},{"SLoepID":"16","Name":"United Democratic Movement (UDM)","Description":"<p>UDM, with the goal of contesting the 2012 election. the UDM was established by former PMDC chair Mohamed Bangura in early 2011. The party received its official legal approval on May 31 and aimed to recruit a large number of youth among its members.</p>","Acronym":"UDM","DateFounded":"2011","Founders":"Mohamed Bangura","Website":"","Color":"Purple","Logo":"udm.jpg"},{"SLoepID":"17","Name":"United National Peoples party (UNPP)","Description":"<p>The UNPP secured 17 seats behind a 21 percent vote tally in the February 1996 balloting. Meanwhile, its leader, banker John Karifa-Smart, placed second in concurrent presidential balloting. In march 1997 Karifa-Smart was charged with contempt and suspended from the assembly. He also unsuccessfully attempted in April 2001 to expel some legislators from the party due to differences on certain policies. Karifa-Smart came in last, with 1 percent of the vote, in May 2002 presidential election,and the UNPP failed to win any seats in the legislative contest, with 1.3 percent of the vote. Following the election, a cabinet minister who had been a member of the UNPP joined the SLPP. In May 2005 the UNPP joined in coalition with the National Unity Movement (NUM, below) in advance of the next presidential elections. It backed out of a so called merger with RUF after some of the latter's leaders were charged with war crimes.</p>\n\n<p>Karifa-Smart retired from politics in 2006, and Abdul Kadi Karim was elected a party leader and 2007 presidential candidate. He came in last with 0.4 percent of votes. In 2008 the party was one of three ruled ineligible to take part in local elections in march.</p>","Acronym":"UNPP","DateFounded":"","Founders":"","Website":"","Color":"Yellow","Logo":""},{"SLoepID":"1036","Name":"Unity Party (UP)","Description":"","Acronym":"UP","DateFounded":"2017","Founders":"NEC","Website":"","Color":"Blue","Logo":"up.jpg"},{"SLoepID":"85","Name":"Young People&#039;s Party (YPP)","Description":"","Acronym":"YPP","DateFounded":"","Founders":"","Website":"","Color":"","Logo":""}]

